(51, 52, 'Fwd: May 11, 2018 : AIPLA_Women in IP: You are Invited!', 'Ashwani Garg <akgarg007@gmail.com>', '1524017441', '<div dir=\"ltr\"><br><div class=\"gmail_quote\"><br>\r\n	\r\n		\r\n	\r\n	<div>\r\n		<div>\r\n			<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"border-style:solid;border-color:rgb(251,225,172)\" width=\"100\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"text-align:right\" valign=\"top\">\r\n							<img alt=\"AIPLA Women in IP\" height=\"90\" src=\"https://cmm.cloudmailstore.com/upload/templateimages/img_folder_53/1523940884_AIPLAheader.png\" width=\"500\"></td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"left\" bgcolor=\"#FFFFF7\" height=\"100\" style=\"padding:0px 20px\">\r\n							<div>\r\n								 </div>\r\n							<div>\r\n								<div style=\"text-align:justify\">\r\n									Dear Colleagues:</div>\r\n								<div style=\"text-align:justify\">\r\n									 </div>\r\n								<div style=\"text-align:justify\">\r\n									Greetings of the day!</div>\r\n								<div style=\"text-align:justify\">\r\n									 </div>\r\n								<div style=\"text-align:justify\">\r\n									We cordially invite you to 2018 AIPLA women in IP global networking event that will take place at Forum 1 of  The Lalit, Mumbai on May 11th, 2018 from 3:00 PM onwards.</div>\r\n								<div style=\"text-align:justify\">\r\n									 </div>\r\n								<div style=\"text-align:justify\">\r\n									The conference will include, but not limited to providing a platform for a fruitful interaction between IP professionals and addressing the issue faced by today&#39;s women. We would be delighted to have you present at this conference to hear your thoughts.</div>\r\n								<div style=\"text-align:justify\">\r\n									 </div>\r\n								<div style=\"text-align:justify\">\r\n									Please find attached the Invitation, Concept note and Draft agenda. We look forward to your confirmation!</div>\r\n								<div>\r\n									 </div>\r\n								<div>\r\n									Warm Regards,</div>\r\n								<div>\r\n									Manisha</div>\r\n								<div>\r\n									 </div>\r\n								<div>\r\n									<p class=\"m_1491396086597399783m-7597135320613873671wordsection1\" style=\"margin:0in;margin-bottom:.0001pt\">\r\n										Manisha Singh | Partner<u></u><u></u></p>\r\n									<p class=\"m_1491396086597399783m-7597135320613873671wordsection1\" style=\"margin:0in;margin-bottom:.0001pt;line-height:115%\">\r\n										<a href=\"mailto:manisha@lexorbis.com\" target=\"_blank\">manisha@lexorbis.com</a> | M: +91 9811161518<u></u><u></u></p>\r\n								</div>\r\n								<p class=\"m_1491396086597399783m-7597135320613873671wordsection1\" style=\"margin:0in;margin-bottom:.0001pt;line-height:115%\">\r\n									<b>LEX<span style=\"color:#dc6c28\">ORBIS</span></b></p>\r\n							</div>\r\n							<img alt=\" \" height=\"23\" src=\"http://www.lexorbis.com/email/aipla/images/AIPLA-invite-2017_11.jpg\" style=\"display:block\" width=\"523\"></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n		</div>\r\n		<div>\r\n			 </div>\r\n	\r\n<p>If you&#39;d like to unsubscribe and stop receiving these emails <a href=\"https://u2130187.ct.sendgrid.net/wf/unsubscribe?upn=o97s72mw2l-2B-2BTV1DU5SesHXTV5X6kDjGZq0KswfIlh782E1O0gnC-2F86VWNAFwtYOj28J42cqK0CbM6sivfztLPV0LolKAh5WyoI2Qkulaok9S5LVhx0KoqLUgHNRN0yA5AfkyvKGydX6UiusOO61HU9m5WI6tc0mD9-2BF4eooNai55lVHmDg0BOk73BrYvOe4jiG-2FGm-2F-2FPWJk5QyqZisIfS2GtqVVzqiRxakOQS1eWRZOA1cPqLjv7OBpmRSbbaQqErdOwZh2J4E-2FTuIJGWtLnZUdJkEjZk1i33jw8FX-2FEHCMf-2FpjA9Y6pgy9MrpMGYCX\" target=\"_blank\">click here</a>.</p>\r\n\r\n<img src=\"https://u2130187.ct.sendgrid.net/wf/open?upn=o97s72mw2l-2B-2BTV1DU5SesHXTV5X6kDjGZq0KswfIlh782E1O0gnC-2F86VWNAFwtYOj28J42cqK0CbM6sivfztLPV0LolKAh5WyoI2Qkulaok9S5LVhx0KoqLUgHNRN0yATUS6x2hfhCVXvh-2Bog-2FCee-2Fk8ABqRgXA-2FPRIP1ZHIRQGZ1wlo4mLG9Kx12ULkwKhwxKQNF-2Frd49EqVRAys-2F7O2dv-2BjH9YPXZo5gLw9gMRTnyT1zSCilEadMAZiwhLOQ0XPMimIeDckNKktD2HJAkXgQDYK0lZEil-2BXD81ku32dzKi5-2B9P1guNOAQEKqpVw6LI\" 