(55, 56, 'Fwd: High amount of SPAM originating from account alazizisupport@alaziziglobalpr', 'ashwani codesoftic <ashwani.codesoftic@gmail.com>', '1524018379', '<div dir=\"ltr\"><div class=\"gmail_quote\"><div class=\"gmail_quote\">Dear Customer,<br>\r\n<br>\r\nWe have observed unusual email activity from one of your email accounts <a href=\"mailto:alazizisupport@alaziziglobalprojects.com\" rel=\"noreferrer\" target=\"_blank\">alazizisupport@<wbr>alaziziglobalprojects.com</a> under the domain <a href=\"http://agpoman.com\" rel=\"noreferrer noreferrer\" target=\"_blank\">agpoman.com</a>.<br>\r\n<br>\r\n<br>\r\nOver the past 24 hours, our SPAM detection and prevention engine has detected that the email account <a href=\"mailto:alazizisupport@alaziziglobalprojects.com\" rel=\"noreferrer\" target=\"_blank\">alazizisupport@<wbr>alaziziglobalprojects.com</a> has breached the email rate limit multiple times.<br>\r\n<br>\r\nNOTE: Logs of emails detected by our SPAM engine are attached below.<br>\r\n<br>\r\nIn order to prevent further damage to our infrastructure and keep the reputation of IP address intact, we have temporarily suspended the outgoing email funtionality (SMTP service) for the email account <a href=\"mailto:alazizisupport@alaziziglobalprojects.com\" rel=\"noreferrer\" target=\"_blank\">alazizisupport@<wbr>alaziziglobalprojects.com</a>. Please note that you will still be able to receive emails. Only the outgoing email (SMTP service) has been suspended.<br>\r\n<br>\r\nBefore you request for unsuspension, we ask you to run through the following checklist and take necessary action wherever applicable:<br>\r\n<br>\r\n* Reset the password for email accounts with more complex and secure passwords.<br>\r\n* If a mail client is being used to send/receive emails (Outlook, Thunderbird etc), please scan the entire PC where the email account is setup. The PC may be infected with malware operated by spambots.<br>\r\n* If a CMS (Wordpress,Joomla etc.) is involved, please check for vulnerable plugins and upgrade the plugins/CMSs as soon as possible. Also, it is recommended to change the admin password of the CMS.<br>\r\n* Recheck the email script, fix the loopholes in the script.<br>\r\n* Setup captcha for your email form.<br>\r\n* Refrain from sending bulk emails via scripts.<br>\r\n<br>\r\n<br>\r\nFor any further clarifications, unsuspension requests, please contact our Support helpdesk.<br>\r\n<br>\r\nRegards,<br>\r\nThe Hostgator India Team<br>\r\n<br>\r\nDisclaimer: This is an auto-generated email sent by our monitoring system. Please contact our Support helpdesk for further information.</div>\r\n</div><br></div>\r\n', 1, '2018-04-18 02:37:13', '0'),
