(2, '<p></p><div><h2>What gets checked by the demo?</h2><p>Executive summary:</p><ul><li><strong>Accessibility</strong>&nbsp;- test against W3 WCAG1, WCAG2 and Section 508 checkpoints</li><li><strong>Broken Links</strong>&nbsp;- find broken links and missing images in HTML, Flash and CSS</li><li><strong>Browser Compatibility</strong>&nbsp;- find HTML, CSS and JavaScript that doesn\'t work in common web browsers</li><li><strong>Search Engine Optimization</strong>&nbsp;- check for best-practice search optimization and test against Google, Bing and Yahoo webmaster guidelines</li><li><strong>Plus</strong>&nbsp;- check sites for usability, and HTML standards using 700+ standards based checkpoints</li></ul><p><br></p></div><div><h2>Why can\'t I check or map some sites?</h2><p>The online demo is not able to scan sites behind your firewall, or on your hard disk. The trial download is able to do this.</p></div><div><h2>How do the online demos and trial downloads differ?</h2><p>The online demos are limited to 10 pages and can only scan sites visible on the internet.</p><p>The SortSite trial download:</p><ul><li>Checks up to 100 pages</li><li>Checks sites behind your firewall, as well as public web sites</li><li>Exports reports to Word, Excel and HTML</li></ul><p>The PowerMapper trial download:</p><ul><li>Maps up to 1000 pages</li><li>Maps sites behind your firewall, as well as public web sites</li><li>Exports Google and HTML site maps</li></ul></div><br><p></p>', 41, 20, '2017-12-25 18:21:45'),
(3, '<p>faw</p>', 65, 24, '2018-03-10 07:54:40');

