(1, 1, 1, 'An easy to use strata building management platform ', 'Our SECURE online platform provides you the tools to help your strata run better-\r\n\r\n\r\nA great solution for any sized strata - self or professionally managed \r\n\r\n', 'Simple dashboard design ', 'Our user friendly system provides all the information you need - just one click away ', 'Surveys on demand', 'Ask owners for feedback at any time, use our survey to gather more information on important building matters', 'Building Page + Email ', 'Strata365.com/YourBuilding  -  Building page and email included -  YourBuilding@Strata365.com', 'What is the advantage of using Strata365? ', 'Our affordable platform helps by providing the tools needed to run a strata easier and better - More information on demand. Transparency for owners, council members and also providing access to tenants. ', 'A cloud based I.T company in Vancouver BC, Canada  helping strata\'s coast to coast. \r\nFounded to give strata\'s a better solution for communication, organization and more... \r\nWe offer a professional service at a great price that is both easy to use and to manage. ', 'Support@Strata365.com', '604-789-6350', '<< Email Us', '<p></p><h1>FAQ</h1><p><br></p><div><h2>Why use our service?</h2><p><br></p><ul><li><strong>Accessibility</strong>&nbsp;- Easy to use, easy to manage</li><li><b>Affordability</b>&nbsp;- We provide you hosting and the platform at a great price</li><li><b>Features&nbsp;&nbsp;</b>- Only the features you need, nothing more or less<b></b></li><li><b>Support</b>&nbsp;- Customer for life: Always here to support our clients.&nbsp;</li></ul></div><div><h2>Why was Strata365 created?</h2><p>I\'ve been a strata home owner for years, a contractor working for multiple buildings and a council member. I\'ve worked closely with property managers and councils and there has always been a missing step to bring more information together and make running a building - or several - much easier - Strata365 was in the making.&nbsp;</p><p>An affordable service providing online tools for any sized strata that is easy to use, professional and with fantastic customer service.&nbsp;</p><p>RD. B&nbsp;&nbsp;<br></p><p><br></p><h1>&nbsp;<br></h1></div><p></p>', 'Additional Services', 'Custom Options', 'Including ', 'Instant results', 'Unique page and email ', 'Site administration - If you need additional assistance with uploading files, creating document templates etc...  We can provide these services for you', 'Custom options -  Our platform allows additional features and custom options for any sized property. If you need any custom features this can be provided at little or no cost - ', 'Web hosting for your building documents, email address provided - setup in less than 1 business day in most cases - or on the spot after an in-person demo.  ', 'Connect with owners more often with our integrated building survey - Export the results with Excel > The strata council and property manager can view the comments left by owners. ', 'Integrated building page and Email address \r\nStrata365.com/YourBuilding \r\nYourBuilding@strata365.com');

